// src/components/ChatPage.js
import React, { useState } from 'react';
import { 
  Box, Drawer, List, ListItem, ListItemButton, ListItemText, 
  AppBar, Toolbar, Typography, TextField, Button, Divider 
} from '@mui/material';

const drawerWidth = 240;

// Exemplo de lista de agentes (você pode buscar isso via API)
const agents = [
  { id: 1, name: 'Agente Alpha' },
  { id: 2, name: 'Agente Beta' },
  { id: 3, name: 'Agente Gamma' },
];

function ChatPage() {
  const [selectedAgent, setSelectedAgent] = useState(agents[0]);
  const [message, setMessage] = useState("");
  const [chatHistory, setChatHistory] = useState([]);

  const handleAgentSelect = (agent) => {
    setSelectedAgent(agent);
    // Opcional: carregar histórico do agente, se necessário.
  };

  const handleSend = () => {
    if (message.trim() === "") return;
    // Adiciona a mensagem do usuário ao histórico
    const newHistory = [...chatHistory, { sender: "Você", text: message }];
    setChatHistory(newHistory);
    setMessage("");

    // Simulação: Chamada à API de GEN AI para obter resposta
    // Substitua por sua chamada real à API de GEN AI
    setTimeout(() => {
      const aiResponse = `Resposta do ${selectedAgent.name} para "${message}"`;
      setChatHistory([...newHistory, { sender: selectedAgent.name, text: aiResponse }]);
    }, 1000);
  };

  return (
    <Box sx={{ display: 'flex', height: '100vh' }}>
      {/* Menu Lateral */}
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box' },
        }}
      >
        <Toolbar>
          <Typography variant="h6">Agentes</Typography>
        </Toolbar>
        <Divider />
        <List>
          {agents.map((agent) => (
            <ListItem key={agent.id} disablePadding>
              <ListItemButton 
                selected={selectedAgent.id === agent.id} 
                onClick={() => handleAgentSelect(agent)}
              >
                <ListItemText primary={agent.name} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
      </Drawer>
      
      {/* Área Principal do Chat */}
      <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
        <AppBar position="static" sx={{ mb: 2, backgroundColor: "#1976d2" }}>
          <Toolbar>
            <Typography variant="h6" sx={{ flexGrow: 1 }}>
              Chat - {selectedAgent.name}
            </Typography>
          </Toolbar>
        </AppBar>
        {/* Histórico do Chat */}
        <Box 
          sx={{ 
            border: '1px solid #ccc', borderRadius: 2, p: 2, 
            height: '60vh', overflowY: 'auto', backgroundColor: '#f9f9f9' 
          }}
        >
          {chatHistory.map((entry, index) => (
            <Box 
              key={index} 
              sx={{ mb: 1, textAlign: entry.sender === "Você" ? "right" : "left" }}
            >
              <Typography 
                variant="body1" 
                sx={{ 
                  display: 'inline-block', 
                  p: 1, 
                  borderRadius: 1, 
                  backgroundColor: entry.sender === "Você" ? '#1976d2' : '#e0e0e0', 
                  color: entry.sender === "Você" ? 'white' : 'black'
                }}
              >
                {entry.text}
              </Typography>
            </Box>
          ))}
        </Box>
        {/* Campo de Entrada e Botão */}
        <Box sx={{ display: 'flex', mt: 2 }}>
          <TextField
            fullWidth
            variant="outlined"
            placeholder="Digite sua mensagem..."
            value={message}
            onChange={(e) => setMessage(e.target.value)}
          />
          <Button variant="contained" color="primary" onClick={handleSend} sx={{ ml: 1 }}>
            Enviar
          </Button>
        </Box>
      </Box>
    </Box>
  );
}

export default ChatPage;
